import{_ as e,o,c as a,b as t}from"./app-de7a4551.js";const s={},i=t('<h1 id="macos" tabindex="-1"><a class="header-anchor" href="#macos" aria-hidden="true">#</a> macOS</h1><p>The macOS operating system is a line of <code>proprietary</code> graphical operating systems developed and <code>marketed</code> by Apple Inc. as the primary operating system installed on its <code>Macintosh</code> computer series, as well as other Apple computers and devices such as the iPod Touch, iPad, iPhone, and Apple TV. It is also used on some models of MacBook Air, MacBook Pro, iMac, Mac mini, and PowerBook G4. The latest version is macOS Ventura, released in November 2021.</p><details class="custom-container details"><summary>translation</summary><p>MacOS 操作系统是苹果公司开发和销售的一系列专有图形操作系统，作为其 Macintosh 系列电脑以及其他苹果电脑和设备(如 iPod Touch、 iPad、 iPhone 和 Apple TV)的主要操作系统。它也被用于一些型号的 MacBook Air，MacBook Pro，iMac，Mac mini 和 PowerBook G4。最新版本是2021年11月发布的 macOS Ventura。</p></details><details class="custom-container details"><summary>words</summary><p>proprietary<br><code>英 [prəˈpraɪət(ə)ri]美 [prəˈpraɪəteri]</code></p><blockquote><p>adj. 所有的，所有权的；专卖的，专利的；所有者的；私有的，私密的<br> n. 所有权；所有人</p></blockquote><p>market<br><code>英: [ˈmɑː(r)kɪt] 美: [ˈmɑrkət]</code></p><blockquote><p>n. 市场；商场；集市；交易<br> v. 推销；促销</p></blockquote><p>Macintosh<br><code>英: [&#39;mækintɔʃ] 美: [ˈmækɪntɑʃ]</code></p><blockquote><p>n. 苹果电脑<br> n. （Macintosh）（美）麦金托什（人名）<br> n. （macintosh）麦金托什雨衣；防水胶布（等于mackintosh）</p></blockquote></details><p>macOS was first introduced in 2001 as the operating system for the Mac OS X series of graphical desktop and notebook computers. It has <code>undergone</code> <code>significant</code> design changes and improvements over the years, with each new release introducing new features and <code>functionality</code>. Some of the key features of macOS include:</p><details class="custom-container details"><summary>translation</summary><p>MacOS 于2001年首次推出，作为 MacOSX 系列图形桌面和笔记本电脑的操作系统。多年来，它经历了重大的设计变化和改进，每个新版本都引入了新的特性和功能。MacOS 的一些关键特性包括:</p></details><details class="custom-container details"><summary>words</summary><p>undergo<br><code>英: [ˌʌndə(r)ˈɡəʊ] 美: [ˌʌndərˈɡoʊ]</code></p><blockquote><p>v. 经受(检阅,考验等)；经验；遭受(苦难等)</p></blockquote><p>significant<br><code>英 [sɪɡˈnɪfɪkənt] 美 [sɪɡˈnɪfɪkənt]</code></p><blockquote><p>adj. 显著的，相当数量的；重要的，意义重大的； 别有含义的，意味深长的<br> n. &lt;古&gt;象征，有意义的事物</p></blockquote><p>functionality<br><code>英: [.fʌŋkʃə&#39;nælɪti] 美: [ˌfʌŋkʃəˈnælɪti]</code></p><blockquote><p>n. 实用；符合实际；设计目的；设计功能</p></blockquote></details><ul><li><code>Seamless</code> <code>integration</code> with other Apple products and services</li><li>A user-friendly interface that is easy to navigate</li><li>Built-in support for various media formats including music, video, and photos</li><li>Powerfull built-in applications such as Safari, Pages, Numbers, and iMovie</li><li>Advanced security features to protect your data from <code>viruses</code> and <code>malware</code></li><li>Support for cloud storage and syncing across multiple devices</li></ul><details class="custom-container details"><summary>translation</summary><ul><li>与其他苹果产品和服务无缝集成</li><li>一个易于导航的友好界面</li><li>内置对各种媒体格式的支持，包括音乐、视频和照片</li><li>强大的内置应用程序，如 Safari、Pages、Numbers 和 iMovie</li><li>高级安全功能可保护您的数据免受病毒和恶意软件的攻击</li><li>支持跨多个设备的云存储和同步</li></ul></details><details class="custom-container details"><summary>words</summary><p>seamless<br><code>英 [ˈsiːmləs] 美 [ˈsiːmləs]</code></p><blockquote><p>adj. 无缝的；无缝合线的；无伤痕的</p></blockquote><p>integration<br><code>英 [ˌɪntɪˈɡreɪʃ(ə)n] 美 [ˌɪntɪˈɡreɪʃ(ə)n]</code></p><blockquote><p>n. 结合，融合；取消种族隔离；（数）积分法，求积分；（心理分析）整合</p></blockquote><p>viruses<br><code>英 [ˈvaɪərəsɪz]美 [ˈvaɪərəsɪz]</code></p><blockquote><p>n. [病毒]病毒；病霉（virus 的复数）</p></blockquote><p>malware<br><code>英 [ˈmælweə(r)] 美 [ˈmælwer]</code></p><blockquote><p>n. 恶意软件</p></blockquote></details><p>macOS is known for its stability, performance, and security compared to other operating systems. It is widely used by both <code>casual</code> and professional users alike due to its <code>intuitive</code> interface and powerful capabilities.</p><details class="custom-container details"><summary>translation</summary><p>与其他操作系统相比，MacOS以其稳定性、性能和安全性而闻名。由于其直观的界面和强大的功能，它被普通用户和专业用户广泛使用。</p></details><details class="custom-container details"><summary>words</summary><p>casual<br><code>英: [&#39;kæʒuəl] 美: [ˈkæʒuəl]</code></p><blockquote><p>n. 临时工；便装；便鞋<br> adj. 不经意的；无忧无虑的；漫不经心的；不在乎的</p></blockquote><p>intuitive<br><code>英 [ɪnˈtjuːɪtɪv]美 [ɪnˈtuːɪtɪv]</code></p><blockquote><p>adj. 直觉的；有直觉力的；易懂的，使用简便的</p></blockquote></details>',13),c=[i];function r(l,n){return o(),a("div",null,c)}const p=e(s,[["render",r],["__file","06-macos.html.vue"]]);export{p as default};
